    />
  ),
  MDXHeader,
  ComponentPreview,
  ComponentSource,
  Alert,
  AlertTitle,
  AlertDescription,
  Callout
}

import { createSignal, mergeProps, splitProps, type Component, type ComponentProps } from "solid-js"

import { cn } from "@/lib/utils"
import { Button } from "@/components/ui/button"
import { Collapsible, CollapsibleContent, CollapsibleTrigger } from "@/components/ui/collapsible"

interface CodeBlockProps extends ComponentProps<"div"> {
  expandButtonTitle?: string
}

const CodeBlockWrapper: Component<CodeBlockProps> = (rawProps) => {
  const props = mergeProps({ expandButtonTitle: "View Code" }, rawProps)
  const [, rest] = splitProps(props, ["expandButtonTitle", "class", "children"])

  const [isOpened, setIsOpened] = createSignal(false)

  return (
    <Collapsible open={isOpened()} onOpenChange={setIsOpened} forceMount>
      <div class={cn("relative overflow-hidden", props.class)} {...rest}>
        <CollapsibleContent class={cn("overflow-hidden", !isOpened() && "max-h-32")}>
          <div
            class={cn(
              "[&_pre]:my-0 [&_pre]:max-h-[650px] [&_pre]:pb-[100px]",
              !isOpened() ? "[&_pre]:overflow-hidden" : "[&_pre]:overflow-auto]"
            )}
          >
            {props.children}
          </div>
        </CollapsibleContent>
        <div
          class={cn(
            "absolute flex items-center justify-center bg-gradient-to-b from-zinc-700/30 to-zinc-950/90 p-2",
            isOpened() ? "inset-x-0 bottom-0 h-12" : "inset-0"
          )}
        >
          <CollapsibleTrigger as={Button<"button">} variant="secondary" class="h-8 text-xs">
            {isOpened() ? "Collapse" : props.expandButtonTitle}
          </CollapsibleTrigger>
        </div>
      </div>
    </Collapsible>
  )
}

export { CodeBlockWrapper }

import {
  createMemo,
  mergeProps,
  Show,
  splitProps,
  type Component,
  type ComponentProps
} from "solid-js"

import { Index } from "@/__registry__"
import { cn } from "@/lib/utils"
import { Tabs, TabsContent, TabsList, TabsTrigger } from "@/components/ui/tabs"

interface ComponentPreviewProps extends ComponentProps<"div"> {
  name: string
  source: string
  align?: "center" | "start" | "end"
  type?: "block" | "component" | "example"
}

const ComponentPreview: Component<ComponentPreviewProps> = (rawProps) => {
  const props = mergeProps({ align: "center" } as const, rawProps)
  const [local, others] = splitProps(props, ["class", "align", "children", "name", "type"])

  const Preview = createMemo(() => {
    const Component = Index[local.name]?.component

    if (!Component) {
      return (
        <p class="text-sm text-muted-foreground">
          Component{" "}
          <code class="relative rounded bg-muted px-[0.3rem] py-[0.2rem] font-mono text-sm">
            {local.name}
          </code>{" "}
          not found in registry.
        </p>
      )
    }

    return <Component />
  })

  return (
    <Show
      when={local.type !== "block"}
      fallback={
        <div class="relative aspect-[4/2.5] w-full overflow-hidden rounded-md border">
          <div class="absolute inset-0 hidden w-[1600px] bg-background md:block">
            <iframe src={`/blocks/${local.name}`} class="size-full" />
          </div>
        </div>
      }
    >
      <div class={cn("group relative my-4 flex flex-col space-y-2", local.class)} {...others}>
        <Tabs defaultValue="preview" class="relative mr-auto w-full">
          <div class="flex items-center justify-between pb-3">
            <TabsList class="w-full justify-start rounded-none border-b bg-transparent p-0">
              <TabsTrigger
                value="preview"
                class="relative h-9 rounded-none border-b-2 border-b-transparent bg-transparent px-4 pb-3 pt-2 font-semibold text-muted-foreground shadow-none transition-none data-[selected]:border-b-primary data-[selected]:text-foreground data-[selected]:shadow-none"
              >
                Preview
              </TabsTrigger>
              <TabsTrigger
                value="code"
                class="relative h-9 rounded-none border-b-2 border-b-transparent bg-transparent px-4 pb-3 pt-2 font-semibold text-muted-foreground shadow-none transition-none data-[selected]:border-b-primary data-[selected]:text-foreground data-[selected]:shadow-none"
              >
                Code
              </TabsTrigger>
            </TabsList>
          </div>
          <TabsContent value="preview" class="relative rounded-md border">
            <div
              class={cn(
                "preview flex min-h-[350px] w-full justify-center p-10",
                local.align === "center" && "items-center",
                local.align === "start" && "items-start",
                local.align === "end" && "items-end"
              )}
            >
              <Preview />
            </div>
          </TabsContent>
          <TabsContent value="code">
            <div class="flex flex-col space-y-4">
              <div class="w-full rounded-md [&_pre]:my-0 [&_pre]:max-h-[350px] [&_pre]:overflow-auto">
                {local.children}
              </div>
            </div>
          </TabsContent>
        </Tabs>
      </div>
    </Show>
  )
}

export { ComponentPreview }

